import styled from "styled-components";

const Ground = styled.section`
  width: 100vw;
  border: 1px black solid;
  display: flex;
  align-content: center;
  flex-direction: column;
`

const HeaderDiv = styled.section`
  margin-top: 20px;
  width: 850px;
  height: 100px;
  border: 1px black solid;
`;

const ContentDiv = styled.section`
  margin-top: 20px;
  width: 850px;
  height: 100px;
  border: 1px black solid;
`;

function App() {
  return (
    <Ground>
      <HeaderDiv />
      <ContentDiv />
    </Ground>
  );
}

export default App;
